# 함수 만들어서 사용하기 실습문제2
import time
import math
def find_chr(str, fch):
    count = 0
    for ch in str:
        if ch == fch:
            count += 1
    return count

def find_chr2(str, fch):
    count = 0
    i = 0
    while True:
        if str.find(fch,i) == -1:
            break
        else:
            i = str.find(fch,i) + 1
            count += 1
    return count

def func_string():
    try:
        str = input('문자열 : ')
        fch = input('찾을 문자 : ')

        print(f'{str} 에 {fch} 가 {find_chr(str, fch)}개 들어있습니다.')
    except Exception as msg:
        print('먼지 모를 에러가 발생했어요~', msg)
    finally:
        print('문자열에서 문자찾기 종료')
